import React, { Component } from 'react';
import kids from '../assets/PNG/INDIVIDUAL/kids.png';
import bubl from '../assets/PNG/INDIVIDUAL/bubl.png';

class Home extends Component {
  render() {
    return (
      <div>
        <div class="container mt-5">
          <div class="row">
            <div class="col-sm-6 bg-dark">
              <h2 class="content-title title-one">find friends</h2>
              <h2 class="content-title title-two">have fun</h2>
              <h2 class="content-title title-three">grow your</h2>
              <img
                height="80"
                src={bubl}
                alt="bubl logo Image"/>
            </div>
            <div class="col-sm-6 bg-light" />
            <img height="90" src={kids} alt="Kids Image" />
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
